import * as React from 'react';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import { useNavigate } from 'react-router-dom';


const Frontpage = () => {
  
  const nav=useNavigate();

  const nexth=()=>{
      nav("/home")
  }
  
  const nexta=()=>{
    nav("/aboutus")
}

  const nexts=()=>{
    nav("/schemes")
  }

  const nextc=()=>{
    nav("/contactus")
  }
  
  return (
    <div style={{backgroundColor:'#FFFFFF'}}>
    <Stack spacing={2} direction="row" style={{paddingLeft:"35px",paddingTop:"30px",color:'#002F6C'}}>

    <img src="data:image/png;base64," style={{height:"60px",paddingLeft:"500px"}} alt=""></img>
    <h1 style={{color:'#002F6C'}}>GOVERNMENT OF INDIA</h1>
 
    </Stack>    
    <br></br>
    <Stack spacing={2} direction="row" style={{paddingLeft:"570px",paddingTop:"10px",paddingBottom:'20px'}}>
        <Button variant='contained' onClick={nexth} style={{color:'#white',fontSize:'17px'}}>Home</Button>
        <Button variant='contained' onClick={nexta} style={{color:'#white',fontSize:'17px'}}>About Us</Button>
        <Button variant='contained' onClick={nexts} style={{color:'#white',fontSize:'17px'}}>Schemes</Button>
        <Button variant='contained' onClick={nextc} style={{color:'#white',fontSize:'17px'}}>Contact Us</Button>
    </Stack>
<br></br>
    <img src='data:image/jpeg;base64,' alt='' style={{height:"600px",width:"1300px",paddingLeft:'310px'}}></img>
    

    <div style={{textAlign:'center',fontSize:'20px',border:'5px solid gray',marginLeft:'300px',marginRight:'200px',marginTop:'10px'}}>
        <h2 style={{color:'#0029a5'}}>Overview</h2><br></br>
        <div style={{color:''}}>
        <p>Government schemes in India are initiatives and programs launched by the central and state governments to address various socio-economic challenges and provide support to different sections of society. These schemes cover a wide range of sectors, including agriculture, education, healthcare, infrastructure, employment, social welfare, and more. Here is an overview of some prominent government schemes in India:</p>
        <ol>
        <li> Pradhan Mantri Jan Dhan Yojana (PMJDY):
        Launched in 2014, PMJDY aims to provide financial inclusion by ensuring access to banking services for all individuals. The scheme provides a bank account, insurance coverage, and an overdraft facility to eligible individuals.
        </li><br></br>
        <li>
        Pradhan Mantri Ujjwala Yojana (PMUY):
        Launched in 2016, PMUY aims to provide clean cooking fuel to women from below-poverty-line households. The scheme provides free LPG connections and financial assistance to eligible beneficiaries.
        </li><br></br>
        <li>
         Mahatma Gandhi National Rural Employment Guarantee Act (MGNREGA):
        Implemented in 2005, MGNREGA guarantees 100 days of wage employment to rural households. It provides income support through manual labor on public works projects and aims to enhance livelihoods and reduce rural distress.
        </li><br></br>
        <li>
        Pradhan Mantri Awas Yojana (PMAY):
        Launched in 2015, PMAY aims to provide affordable housing for all by 2022. It offers financial assistance and subsidies to eligible households for constructing or purchasing houses.
        </li><br></br>
        <li>
        Ayushman Bharat - Pradhan Mantri Jan Arogya Yojana (PMJAY):
        Launched in 2018, PMJAY is a health insurance scheme that provides coverage for over 50 crore individuals, primarily from economically weaker sections. It offers cashless treatment for certain illnesses and procedures at empaneled hospitals.
        </li><br></br>
        <li>
        Swachh Bharat Abhiyan:
        Launched in 2014, Swachh Bharat Abhiyan (Clean India Mission) aims to achieve universal sanitation coverage and promote cleanliness and hygiene. It focuses on constructing household toilets, ending open defecation, and ensuring proper solid waste management.
        </li><br></br>
        <li>
        Digital India:
        Launched in 2015, Digital India is an umbrella program that aims to transform India into a digitally empowered society and knowledge economy. It focuses on improving digital infrastructure, digital literacy, and delivering government services electronically.
        </li><br></br>
        </ol>
        <p>These are just a few examples of the numerous government schemes in India. The government regularly introduces new schemes and modifies existing ones based on evolving needs and priorities. Each scheme has specific eligibility criteria, application procedures, and benefits. Detailed information about each scheme, including eligibility and application processes, can be found on the respective government scheme websites or official portals.</p>
        </div>
    </div>
    
    </div>
  );
}

export default Frontpage